import React from "react";

const About = () => (
  <section className="about">
    <p className="welcome--about">
    Endeavor Catalyst is an innovative co-investment vehicle designed 
    to support Endeavor Entrepreneurs with their equity financing rounds 
    and contribute to the long-term sustainability of Endeavor.
    </p>
  </section>
);

export default About;
